import React from "react"

function Footer() {
  return (
    <footer>
      <div>
        Developed by Aleksander Gralewski, 2020
      </div>
      <i class="fab fa-github"></i>
      <i class="fab fa-linkedin-in"></i>
    </footer>
  )
}

export default Footer
